from langflow.custom import Component
from langflow.io import DataInput, Output
from langflow.schema import Data
from bs4 import BeautifulSoup

class ExtractGitLabExploreProjects(Component):
    display_name = "Extract GitLab Explore Projects"
    description = "Extracts project details from GitLab explore page HTML."
    icon = "custom_components"

    inputs = [
        DataInput(name="html_content", display_name="HTML Content", info="Paste the HTML content to extract project details from.")
    ]

    outputs = [
        Output(display_name="Project Data", name="project_data", method="extract_projects"),
    ]

    def extract_projects(self) -> Data:
        # Get the HTML content as a string from the input
        html_content = self.html_content.value  # Extract the value from the Data object
        soup = BeautifulSoup(html_content, 'html.parser')
        projects = []

        project_rows = soup.select('.js-projects-list-holder .project-row')
        for row in project_rows:
            try:

                project_info = {}
                project_link = row.select_one('.project')
                project_href = project_link.get('href')
                stars = self.try_extract('.stars', row)
                forks = self.try_extract('.forks', row)
                issues = self.try_extract('.issues', row)
                merge_requests = self.try_extract('.merge-requests', row)
                try: 
                    last_updated =  self.try_extract('.updated-note .js-timeago', row, raw_attr=True).get('datetime')
                except AttributeError:
                    last_updated = None

                project_info['name'] = project_href
                project_info['stars'] = stars
                project_info['forks'] = forks
                project_info['issues'] = issues
                project_info['merge_requests'] = merge_requests
                project_info['last_updated'] = last_updated

                projects.append(project_info)
            except Exception as e:
                raise(f"Error extracting project info: {e}")

        if len(projects) == 0:
            return Data(value=None, error="No projects found in the HTML content.")
        return Data(value=projects)

    @staticmethod    
    def try_extract(selector, soup, raw_attr=False):
        if soup.select_one(selector) is not None:
            return soup.select_one(selector).text.strip() if not raw_attr else soup.select_one(selector)

from langflow.custom import Component
from langflow.io import MessageTextInput, Output
from langflow.schema.message import Message

import json

class ParseDomainScoreJsonOutput(Component):
    display_name = "Parse Domain Score JSON Output"
    description = "Parses the JSON output from the domain score calculation script."
    icon = "custom_components"

    inputs = [
        MessageTextInput(name="url", display_name="URL", info="Enter the URL to fetch HTML from."),
        MessageTextInput(name="score_json", display_name="Score JSON", info="Enter the JSON output from the domain score calculation script."),
    ]

    outputs = [
        Output(display_name="Output", name="output", method="build_output"),
    ]

    def build_output(self) -> Message:
        url = self.url  # Use self.url to access input value
        score_json = self.score_json  # Use self.score_json to access input value
        try:
            json_data = json.loads(score_json)
            json_data['url'] = url.replace('\n', '')  # Add the URL to the JSON data
            return Message(text=json.dumps(json_data, indent=4))  # Return a Message object with formatted JSON
        except json.JSONDecodeError as e:
            return Message(text=f"Error parsing domain score: {e}")
        except Exception as e:
            return Message(text=f"Unexpected error: {e}")
